              "type": "paragraph",
              "paragraph": {
                "rich_text": [
                  {
                    "type": "text",
                    "text": {
                      "content": "Hyperfocus sessions can vary greatly in duration, typically lasting anywhere from 30 minutes to several hours, depending on the individual, task complexity, and environmental factors."
                    }
                  }
                ]
              }
            }
          ]
        }
